import { useState } from 'react'
import {Radio, RadioGroup } from '@headlessui/react'
import { CheckIcon, XMarkIcon as XMarkIconMini } from '@heroicons/react/20/solid'
import AOS from 'aos';
import 'aos/dist/aos.css';

import '../Pricing.css';
AOS.init({
    duration: 500,
    once: true,
    });
const pricing = {
  frequencies: [
    { value: 'arg', label: 'ARG' },
    { value: 'chi', label: 'CHI' },
    { value: 'col', label: 'COL' },
    { value: 'eurusd', label: 'EUR/USD' },
  ],
  tiers: [
    {
      name: '100K',
      id: 'tier-starter',
      href: '#',
      featured: false,
      description: 'P',
      price: { arg: '$3.500', chi: '$1.805', col: '$16.460', eurusd: '€4' },
      mainFeatures: ['Entrega rápida', 'Sin riesgo de Baneo'],
    },
    {
        name: '300K',
        id: 'tier-starter',
        href: '#',
        featured: false,
        description: 'P',
        price: { arg: '$10.500', chi: '$10.830', col: '$49.380', eurusd: '€12' },
        mainFeatures: ['Entrega rápida', 'Sin riesgo de Baneo'],
      },
    {
      name: '1M',
      id: 'tier-growth',
      href: '#',
      featured: false,
      description: 'Mejora tu plantilla rápidamente.',
      price: { arg: '$35.000', chi: '$36.100', col: '$164.600', eurusd: '€40' },
      mainFeatures: ['Mejora TOP para tu equipo','Entrega rápida', 'Sin riesgo de Baneo'],
    },
  ],
}

function classNames(...classes) {
  return classes.filter(Boolean).join(' ')
}

export default function Pricing() {
  const [frequency, setFrequency] = useState(pricing.frequencies[0])

  const scrollToPricingSection = () => {
    const pricingSection = document.getElementById('pricing-section');
    pricingSection.scrollIntoView({ behavior: 'smooth' });
  };

  return (
<div className="w-full h-70vh ">
  <main>
    {/* Pricing section */}
    <div id="pricing-section" className="overflow-hidden">
      <div className="flow-root py-16 sm:pt-32 lg:pb-0 mb-80">
        <div className="px-6 mx-auto max-w-7xl lg:px-8">
          <div className="relative z-10">
            <h1 className="max-w-4xl mx-auto text-5xl font-bold tracking-tight text-center text-white">
              Precios de Monedas
            </h1>
            <p className="max-w-2xl mx-auto mt-4 text-lg leading-8 text-center text-white/60">
              Precios para cada región
            </p>
            <div className="flex justify-center mt-16">
              <fieldset aria-label="Payment frequency">
                <RadioGroup
                  value={frequency}
                  onChange={setFrequency}
                  className="grid grid-cols-4 p-1 text-xs font-semibold leading-5 text-center text-white rounded-full gap-x-1 bg-white/5"
                >
                  {pricing.frequencies.map((option) => (
                    <Radio
                      key={option.value}
                      value={option}
                      className={({ checked }) =>
                        classNames(
                          checked ? 'bg-indigo-500 text-white' : 'bg-transparent text-white/60',
                          'cursor-pointer rounded-full px-2.5 py-1 transition-colors duration-150 overflow-hidden'
                        )
                      }
                    >
                      {option.label}
                    </Radio>
                  ))}
                </RadioGroup>
              </fieldset>
            </div>
          </div>
          <div className="relative grid max-w-md grid-cols-1 mx-auto mt-10 gap-y-8 lg:mx-0 lg:-mb-14 lg:max-w-none lg:grid-cols-3">
            <div
              className="hidden lg:absolute lg:inset-x-px lg:bottom-0 lg:top-4 lg:block lg:rounded-t-2xl lg:bg-gray-800/80 lg:ring-1 lg:ring-white/10"
              aria-hidden="true"
            />
            {pricing.tiers.map((tier) => (
              <div
                key={tier.id}
                className={classNames(
                  tier.featured
                    ? 'z-10 bg-white shadow-xl ring-1 ring-gray-900/10'
                    : 'bg-gray-800/80 ring-1 ring-white/10 lg:bg-transparent lg:pb-14 lg:ring-0',
                  'relative rounded-2xl'
                )}
              >
                <div className="p-8 lg:pt-12 xl:p-10 xl:pt-14">
                  <h2
                    id={tier.id}
                    className={classNames(
                      'text-slate-400',
                      'text-2xl font-semibold leading-6'
                    )}
                  >
                    {tier.name}
                  </h2>
                  <div className="flex flex-col gap-6 sm:flex-row sm:items-end sm:justify-between lg:flex-col lg:items-stretch">
                    <div className="flex items-center mt-2 gap-x-4">
                      <p
                        className={classNames(
                          tier.featured ? 'text-gray-900' : 'text-white',
                          'text-4xl font-bold tracking-tight'
                        )}
                      >
                        {tier.price[frequency.value]}
                      </p>
                    </div>
                    <a
                      href={tier.href}
                      aria-describedby={tier.id}
                      className={classNames(
                        tier.featured
                          ? 'bg-indigo-600 shadow-sm hover:bg-indigo-500 focus-visible:outline-indigo-600'
                          : 'bg-white/10 hover:bg-white/20 focus-visible:outline-white',
                        'rounded-md px-3 py-2 text-center text-sm font-semibold leading-6 text-white focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2'
                      )}
                    >
                      Contactar para comprar
                    </a>
                  </div>
                  <div className="flow-root mt-8 sm:mt-10">
                    <ul
                      role="list"
                      className={classNames(
                        tier.featured
                          ? 'divide-gray-900/5 border-gray-900/5 text-gray-900'
                          : 'divide-white/5 border-white/5 text-white',
                        '-my-2 divide-y border-t text-sm leading-6'
                      )}
                    >
                      {tier.mainFeatures.map((mainFeature) => (
                        <li key={mainFeature} className="flex py-2 gap-x-3">
                          <CheckIcon
                            className={classNames(
                              tier.featured ? 'text-indigo-600' : 'text-indigo-400',
                              'h-6 w-5 flex-none'
                            )}
                            aria-hidden="true"
                          />
                          {mainFeature}
                        </li>
                      ))}
                    </ul>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  </main>
</div>

  )
}
